import { createSlice } from "@reduxjs/toolkit";

const initialState = { value: ' ' }

export const Role = createSlice({
    name:'Role',
    initialState,
    reducers:{
        Admin : state=>{
            return {
                ...state,
                value:Admin
            }
        },
        SuperAdmin : state=>{
          return  state.value = 'SuperAdmin'
        }

    }
})

export const {Admin , SuperAdmin} = Role.actions

export default Role.reducer
